(3, 129, 'James H.', 'harryskonst@gmail.com', 'http://localhost/wordpress', '::1', '2024-07-18 18:18:46', '2024-07-18 18:18:46', 'Excellent quality t-shirt. Fits perfectly and the fabric is very soft.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/126.0.0.0 Safari/537.36', 'review', 0, 1),
(4, 129, 'Charlotte M.', 'harryskonst@gmail.com', 'http://localhost/wordpress', '::1', '2024-07-18 18:19:29', '2024-07-18 18:19:29', 'Nice shirt, but the color faded a bit after a few washes.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/126.0.0.0 Safari/537.36', 'review', 0, 1),
(5, 129, 'Alexander F.', 'harryskonst@gmail.com', 'http://localhost/wordpress', '::1', '2024-07-18 18:20:13', '2024-07-18 18:20:13', 'Love this t-shirt! It\'s very comfortable and looks great.\r\n', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/126.0.0.0 Safari/537.36', 'review', 0, 1),
(6, 335, 'Nikos L.', 'harryskonst@gmail.com', 'http://localhost/wordpress', '::1', '2024-07-18 18:25:44', '2024-07-18 18:25:44', 'Absolutely love these sneakers! They are super comfortable and stylish. Perfect for both casual and formal wear.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/126.0.0.0 Safari/537.36', 'review', 0, 1),
(7, 335, 'Eleni D.', 'harryskonst@gmail.com', 'http://localhost/wordpress', '::1', '2024-07-18 18:28:16', '2024-07-18 18:28:16', 'Great design and build quality. Only downside is they are a bit tight at first, need some breaking in.', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/126.0.0.0 Safari/537.36', 'review', 0, 1),
(8, 335, 'Yannis P.', 'harryskonst@gmail.com', 'http://localhost/wordpress', '::1', '2024-07-18 18:28:40', '2024-07-18 18:28:40', 'The check pattern is unique and eye-catching. Received many compliments!', 0, '1', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/126.0.0.0 Safari/537.36', 'review', 0, 1),
