(477, 1, '2024-07-18 17:50:05', '2024-07-18 17:50:05', '<!-- wp:heading {\"level\":3} -->\n<h3 class=\"wp-block-heading\">1. What payment methods do you accept?</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We accept major credit cards (Visa, MasterCard, American Express), PayPal, and bank transfers. All transactions are secure and encrypted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 class=\"wp-block-heading\">2. Do you ship internationally?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Yes, we ship to most countries worldwide. Shipping costs and delivery times will vary based on the destination.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 class=\"wp-block-heading\">3. How can I track my order?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Once your order has been shipped, you will receive an email with a tracking number and a link to track your package.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 class=\"wp-block-heading\">4. What is your return policy?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We offer a 30-day return policy for unused and unopened products. Please contact our customer service to initiate a return.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 class=\"wp-block-heading\">5. How do I cancel my order?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>To cancel your order, please contact our customer service team as soon as possible. If the order has not been processed or shipped, we will cancel it and issue a refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 class=\"wp-block-heading\">6. Are your products cruelty-free?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Yes, we are committed to offering cruelty-free products. None of our products are tested on animals.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 class=\"wp-block-heading\">7. Can I purchase gift cards?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Yes, we offer electronic gift cards that can be purchased and used on our website. They make perfect gifts for any occasion.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 class=\"wp-block-heading\">8. Do you offer discounts for bulk purchases?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Yes, we offer discounts for bulk purchases. Please contact our customer service team for more information and to get a quote.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 class=\"wp-block-heading\">9. How do I use a promo code?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>During the checkout process, you will see a field to enter your promo code. Enter the code and click \"Apply\" to see the discount reflected in your total.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 class=\"wp-block-heading\">10. What should I do if I receive a damaged product?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you receive a damaged product, please contact our customer service immediately with your order number and photos of the damaged item. We will arrange for a replacement or refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 class=\"wp-block-heading\">11. Can I change my shipping address after placing an order?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>If you need to change your shipping address, please contact our customer service as soon as possible. If the order has not yet been shipped, we will update the shipping information.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 class=\"wp-block-heading\">12. Do you offer gift wrapping services?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Yes, we offer gift wrapping services for an additional fee. You can select this option during checkout.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 class=\"wp-block-heading\">13. How can I contact customer service?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>You can contact our customer service team via email at <a>support@EleganceEmporium.com</a>. We are available Monday through Friday from 9 AM to 5 PM.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 class=\"wp-block-heading\">14. Can I create a customer account on your website?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Yes, creating a customer account allows you to track your orders, save your shipping information, and receive exclusive offers. You can create an account during checkout or by clicking on the \"Sign Up\" link at the top of our website.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":4} -->\n<h4 class=\"wp-block-heading\">15. What brands do you carry?</h4>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We carry a variety of popular and trusted brands in cosmetics, skincare, makeup, gifts, and clothing. Visit our Brands page to see the full list of brands we offer.</p>\n<!-- /wp:paragraph -->', 'Frequently Asked Questions', '', 'publish', 'closed', 'closed', '', 'frequently-asked-questions', '', '', '2024-07-18 17:50:05', '2024-07-18 17:50:05', '', 0, 'http://localhost/wordpress/?page_id=477', 0, 'page', '', 0),
